import { setTheme, themeSelector } from '../../../redux/features/themeSlice'
import { Button } from './styles'
import { useSelector, useDispatch } from 'react-redux'

const LigthIcon = () => {
  return (
    <svg
      xmlns='http://www.w3.org/2000/svg'
      xmlnsXlink='http://www.w3.org/1999/xlink'
      width={26}
      height={27}
      fill='none'
    >
      <path fill='url(#a)' d='M0 26.82h26v-26H0v26Z' />
      <defs>
        <pattern
          id='a'
          width={1}
          height={1}
          patternContentUnits='objectBoundingBox'
        >
          <use xlinkHref='#b' transform='scale(.00625)' />
        </pattern>
        <image
          xlinkHref='data:image/png;base64,'
          id='b'
          width={160}
          height={160}
        />
      </defs>
    </svg>
  )
}

const DarkIcon = () => {
  return (
    <svg
      xmlns='http://www.w3.org/2000/svg'
      xmlnsXlink='http://www.w3.org/1999/xlink'
      width={26}
      height={27}
      fill='none'
    >
      <path fill='url(#a)' d='M0 26.82h26v-26H0v26Z' />
      <defs>
        <pattern
          id='a'
          width={1}
          height={1}
          patternContentUnits='objectBoundingBox'
        >
          <use xlinkHref='#b' transform='scale(.00625)' />
        </pattern>
        <image
          xlinkHref='data:image/png;base64,'
          id='b'
          width={160}
          height={160}
        />
      </defs>
    </svg>
  )
}

export const ThemeButton = () => {
  const dispatch = useDispatch()
  const { theme } = useSelector(themeSelector)

  const setActualTheme = () => {
    switch (theme) {
      case 'ligth':
        return 'dark'

      default:
        return 'ligth'
    }
  }

  return (
    <Button
      theme={theme}
      onClick={(ev) => {
        ev.preventDefault()
        dispatch(setTheme(setActualTheme()))
      }}
    >
      {theme === 'ligth' ? <DarkIcon /> : <LigthIcon />}
    </Button>
  )
}
